<!DOCTYPE html>
<html lang="ko">
<head>
  <meta charset="UTF-8">
  <title>Hello Transform &amp; Transition &amp; Animations</title>
  <style>
   /*
    div:hover {
      background:blue;
      -webkit-transform: rotateY(180deg);
         -moz-transform: rotateY(180deg);
          -ms-transform: rotateY(180deg);
              transform: rotateY(180deg);
    }
    */
    div {
      float:left;
      margin:10px;
      width:100px;
      height:100px;
      background:red;
      animation: loading 1.5s cubic-bezier(.96,-0.01,.01,1.05) infinite;
      /**
       * animation: loading 1.5s cubic-bezier(.96,-0.01,.01,1.05) infinite;
       * animation : <animation-name>
                     <animation-duration>
                    <anmation-timing-function>
                    <animation-iteration-count>
       */
    }
    @keyframes loading {
      0% {
      -webkit-transform: rotateY(0);
         -moz-transform: rotateY(0);
          -ms-transform: rotateY(0);
              transform: rotateY(0);
      }
      50% {
      -webkit-transform: rotateY(180deg);
         -moz-transform: rotateY(180deg);
          -ms-transform: rotateY(180deg);
              transform: rotateY(180deg);
      }
      100% {
      -webkit-transform: rotateY(0);
         -moz-transform: rotateY(0);
          -ms-transform: rotateY(0);
              transform: rotateY(0);
        }
    }
    /**
     * @keyframes
     * 애니메이션을 정의
     * loading
     * 애니메이션 이름
     */
      /*
       * transition:0.3s all cubic-bezier(.96,-0.01,.01,1.05);
       * 1s = 애니메이션 시간
       * all = 어떤 속성에 적용할 건지
       * ease = timing-function , 베지에 곡선
       * ease = 등속운동
       */
      /*
       * A라는 거에서 B로 바뀌는 순간의 애니메이션
       */
      /*
      -webkit-transform: translate(100%, 100%);
         -moz-transform: translate(100%, 100%);
          -ms-transform: translate(100%, 100%);
              transform: translate(100%, 100%);
              3d로 넣을경우 가속도가 붙음
      */
      /**
      -webkit-transform: rotate(15deg);
         -moz-transform: rotate(15deg);
          -ms-transform: rotate(15deg);
              transform: rotate(15deg);
      */
      /**
      -webkit-transform: skew(15deg, 15deg);
         -moz-transform: skew(15deg, 15deg);
          -ms-transform: skew(15deg, 15deg);
              transform: skew(15deg, 15deg);
      */
  </style>
</head>
